import React from 'react';
import styled, {keyframes} from 'styled-components';

const phone = keyframes`
  0%, 100%{
    transform: translateX(-10px) translateY(5px);
    box-shadow: 0px 2px 5px rgba(0, 0, 0, 0.15);  
  }

  50%{
    transform: translateX(10px) translateY(-5px);
    box-shadow: 0px 2px 5px rgba(0, 0, 0, 0.25);
  }
`

const phoneReverse = keyframes`
  0%, 100%{
    transform: translateX(10px) translateY(-5px);
    box-shadow: 0px 2px 5px rgba(0, 0, 0, 0.25);
  }
  50%{
    transform: translateX(-10px) translateY(5px);
    box-shadow: 0px 2px 5px rgba(0, 0, 0, 0.15);
  }

`

const breathe1 = keyframes`
  0%, 100% {
    transform: translateY(0px) translateX(-3px);
  }
  50% {
    transform: translateY(5px) translateX(2px);
  }
`

const breathe2 = keyframes`
  0%, 100% {
    transform: translateY(0px) translateX(2px);
  }
  50% {
    transform: translateY(-10px) translateX(-3px);
  }
`

const breathe3 = keyframes`
  0%, 100% {
    transform: translateY(3px) translateX(2px);
  }
  50% {
    transform: translateY(-3px) translateX(-5px);
  }
`


const AnimatedSvg = styled.svg`
  .breathe1 {
    animation: ${breathe1} 3s ease-in-out infinite;
  }

  .breathe2 {
    animation: ${breathe2} 5s ease-in-out infinite;
  }

  .breathe3 {
    animation: ${breathe3} 7s ease-in-out infinite;
  }
  
  .phone {
    animation: ${phone} 10s ease-in-out infinite;
  }
  .phone-reverse {
    animation: ${phoneReverse} 6s ease-in-out infinite;
  }
`


